const MODULEMNEMO = 'Module'; // Мнемоника модуля

// При загрузке формы
function onOpen() {
    // Установка дефолтовых значений
    set(MODULEMNEMO + '.OtchetPoVsemNagrazhdennym.Errors', '');

    setEditable(MODULEMNEMO + '.OtchetPoVsemNagrazhdennym.MestoRaboty', false);
    setEditable(MODULEMNEMO + '.OtchetPoVsemNagrazhdennym.Podrazdelenie', false);
    setEditable(MODULEMNEMO + '.OtchetPoVsemNagrazhdennym.Kategoriya', false);
    setEditable(MODULEMNEMO + '.OtchetPoVsemNagrazhdennym.RozhdennyeS', false);
    setEditable(MODULEMNEMO + '.OtchetPoVsemNagrazhdennym.RozhdennyePo', false);
}

// При изменении значения компонентов
function onChange(mnemo, value) {
    if (mnemo == MODULEMNEMO + '.OtchetPoVsemNagrazhdennym.SubektyNagrazhdeniya') {
        if (value == 'Сотрудник' || value == 'Физическое лицо') {
            setEditable(MODULEMNEMO + '.OtchetPoVsemNagrazhdennym.MestoRaboty', true);
            setEditable(MODULEMNEMO + '.OtchetPoVsemNagrazhdennym.Podrazdelenie', true);
            setEditable(MODULEMNEMO + '.OtchetPoVsemNagrazhdennym.Kategoriya', true);
            setEditable(MODULEMNEMO + '.OtchetPoVsemNagrazhdennym.RozhdennyeS', true);
            setEditable(MODULEMNEMO + '.OtchetPoVsemNagrazhdennym.RozhdennyePo', true);    
        } else {
            setEditable(MODULEMNEMO + '.OtchetPoVsemNagrazhdennym.MestoRaboty', false);
            setEditable(MODULEMNEMO + '.OtchetPoVsemNagrazhdennym.Podrazdelenie', false);
            setEditable(MODULEMNEMO + '.OtchetPoVsemNagrazhdennym.Kategoriya', false);
            setEditable(MODULEMNEMO + '.OtchetPoVsemNagrazhdennym.RozhdennyeS', false);
            setEditable(MODULEMNEMO + '.OtchetPoVsemNagrazhdennym.RozhdennyePo', false);
            
            set(MODULEMNEMO + '.OtchetPoVsemNagrazhdennym.MestoRaboty', '');
            set(MODULEMNEMO + '.OtchetPoVsemNagrazhdennym.Podrazdelenie', '');
            set(MODULEMNEMO + '.OtchetPoVsemNagrazhdennym.Kategoriya', '');
            set(MODULEMNEMO + '.OtchetPoVsemNagrazhdennym.RozhdennyeS', '');
            set(MODULEMNEMO + '.OtchetPoVsemNagrazhdennym.RozhdennyePo', '');
        }
    }
}

// При нажатие кнопки
function onClick(mnemo) {
    if (mnemo == MODULEMNEMO + '.OtchetPoVsemNagrazhdennym.Otchet') {
        if (!get(MODULEMNEMO + '.OtchetPoVsemNagrazhdennym.SubektyNagrazhdeniya')) {
            set(MODULEMNEMO + '.OtchetPoVsemNagrazhdennym.Errors', 'Необходимо выбрать тип награжденного');
        } else {
            set(MODULEMNEMO + '.OtchetPoVsemNagrazhdennym.Errors', '');
            console.log(get(MODULEMNEMO + '.OtchetPoVsemNagrazhdennym.SferaDeyatelnosti'));
            let data = {
                inputData: [
                    {key: 'type', value: get(MODULEMNEMO + '.OtchetPoVsemNagrazhdennym.SubektyNagrazhdeniya')},
                    {key: 'startDate', value: get(MODULEMNEMO + '.OtchetPoVsemNagrazhdennym.NachaloPerioda')},
                    {key: 'finishDate', value: get(MODULEMNEMO + '.OtchetPoVsemNagrazhdennym.KonecPerioda')},
                    {key: 'rewardType', value: get(MODULEMNEMO + '.OtchetPoVsemNagrazhdennym.VidNagrady')},
                    {key: 'reward', value: get(MODULEMNEMO + '.OtchetPoVsemNagrazhdennym.Nagrada')},
                    {key: 'sphere', value: get(MODULEMNEMO + '.OtchetPoVsemNagrazhdennym.SferaDeyatelnosti')},
                    {key: 'job', value: get(MODULEMNEMO + '.OtchetPoVsemNagrazhdennym.MestoRaboty')},
                    {key: 'subdivision', value: get(MODULEMNEMO + '.OtchetPoVsemNagrazhdennym.Podrazdelenie')},
                    {key: 'category', value: get(MODULEMNEMO + '.OtchetPoVsemNagrazhdennym.Kategoriya')},
                    {key: 'startBirthDate', value: get(MODULEMNEMO + '.OtchetPoVsemNagrazhdennym.RozhdennyeS')},
                    {key: 'finishBirthDate', value: get(MODULEMNEMO + '.OtchetPoVsemNagrazhdennym.RozhdennyePo')}
                ],
                outputFormat: 'pdf',
                reportId: MODULEMNEMO + '.OtchetPoVsemNagrazhdennym'
                }
            generateReport(data);   
        }
    }
}

// При получении фокуса на компонент
function onFocus(mnemo) {
