//Параметры фильтра
let type = Input.get('type');

//Тип награжденного
let typeFilter;
if (type != '') {
    typeFilter = type;
}

//Начало периода
let startDateFilter = Input.get('startDate');

//Конец периода
let finishDateFilter = Input.get('finishDate');

//Вид награды
let rewardTypeFilter;
if (Input.get('rewardType') != '') {
    rewardTypeFilter = EntityFactory.getCatalogs().get(Input.get('rewardType').mnemo).findByCode(Input.get('rewardType').code).get(0);
}

//Награда
let rewardFilter;
if (Input.get('reward') != '') {
    rewardFilter = EntityFactory.getCatalogs().get(Input.get('reward').mnemo).findByCode(Input.get('reward').code).get(0);
}
//Cфера дейтельности
let sphereFilter;
if (Input.get('sphere') != '') {
    sphereFilter = EntityFactory.getCatalogs().get(Input.get('sphere').mnemo).findByCode(Input.get('sphere').code).get(0);
}

//Место работы
let jobFilter;
if (Input.get('job')) {
    jobFilter = Input.get('job');
}

//Подразделение
let subdivisionFilter = Input.get('subdivision');

//Категория
let categoryFilter = Input.get('category');

//Рожденные в преиод с
let startBirthDateFilter = Input.get('startBirthDate');

//Рожденные в преиод по
let finishBirthDateFilter = Input.get('finishBirthDate');

let subjectRegisterMnemo = MODULEMNEMO + '.Nagrazhdennye';
let subjectRegister = Register.get(subjectRegisterMnemo);
let registerMnemo = MODULEMNEMO + '.Nagrazhdeniya';
let register = Register.get(registerMnemo);
let cancelRegister = Register.get(registerMnemo);

//Выбор шаблона и заполнение шапок шаблонов
if (type == 'Юридическое лицо') {
    Templates.select(MODULEMNEMO + '.OtchetPoVsemNagrazhdennym.IUridicheskieLica');
    
    let headerSection = Templates.getSection('A1:D2');
    Table.addSection(headerSection);

} else if (type == 'Сотрудник') {
    Templates.select(MODULEMNEMO + '.OtchetPoVsemNagrazhdennym.Sotrudniki');
    
    let headerSection = Templates.getSection('A1:I2');
    Table.addSection(headerSection);
    
} else if (type == 'Физическое лицо') {
    Templates.select(MODULEMNEMO + '.OtchetPoVsemNagrazhdennym.FizicheskieLica');
    
    let headerSection = Templates.getSection('A1:I2');
    Table.addSection(headerSection);
    
}

//Заполнение данных шаблонов
for (let record of subjectRegister) {
    let subject = record.getDimension(subjectRegisterMnemo + '.dm.Nagrazhdennyii');
    let collection = register.find({
        Dimensions: {[registerMnemo + '.dm.Nagrazhdennyii']: subject,
                        //[registerMnemo + '.dm.TipNagrazhdennogo']: typeFilter,
                    //[registerMnemo + '.dm.MestoRaboty']: null,
                    //[registerMnemo + '.dm.SferaDeyatelnosti']: sphereFilter
//                    [registerMnemo + '.dm.Podrazdelenie']: subdivisionFilter,
                //    [registerMnemo + '.dm.Kategoriya']: categoryFilter,
                        //[registerMnemo + '.dm.Nagrada']: rewardFilter,
                        //[registerMnemo + '.dm.VidNagrady']: rewardTypeFilter
        },
        Requisites: {[registerMnemo + '.rg.Otozvana']: false }
    });
    
    if (collection.size()) {
        
        for (let record of collection) {
            let organizationName = subject.get(MODULEMNEMO + '.SubektyNagrazhdeniya.NaimenovanieOrganizacii') ?? '';
            let sphere = record.getDimension(registerMnemo + '.dm.SferaDeyatelnosti')?.getTitle() ?? '';
            let reward = record.getDimension(registerMnemo + '.dm.Nagrada').getTitle() ?? '';
            let orderNumber = record.getRequisite(registerMnemo + '.rg.NomerPrikaza');
            let orderDate = formatDate(record.getRequisite(registerMnemo + '.rg.DataPrikaza'));
            let order = orderNumber + ' от ' + orderDate;
            let tn = subject.get(MODULEMNEMO + '.SubektyNagrazhdeniya.TabelnyiiNomer') ?? '';
            let fio = subject.get(MODULEMNEMO + '.SubektyNagrazhdeniya.FIO') ?? '';
            let job = record.getDimension(registerMnemo + '.dm.MestoRaboty') ?? '';
            let jobFunction = subject.get(MODULEMNEMO + '.SubektyNagrazhdeniya.Dolzhnost')?.getTitle() ?? '';
            let petitioner = record.getRequisite(registerMnemo + '.rg.KtoHodataiistvuet') ?? '';
            let birthDate = formatDate(subject.get(MODULEMNEMO + '.SubektyNagrazhdeniya.DataRozhdeniya')) ?? '';
            
            if (type == 'Юридическое лицо') {

                let subjectSection = Templates.getSection('A3:D3');
                let subjectData = {name: organizationName,
                                   //sphere: sphereFilter,
                                   sphere: sphere,
                                   reward: reward,
                                   order: order
                };
                Table.addSection(subjectSection, subjectData);

            } else if (type == 'Сотрудник') {

                let subjectSection = Templates.getSection('A3:I3');
                let subjectData = {tn: tn,
                                   fio: fio,
                                   job: job,
                                   jobFunction: jobFunction,
                                   reward: reward,
                                   order: order,
                                   petitioner: petitioner,
                                   birthDate : birthDate
                };
                Table.addSection(subjectSection, subjectData);

            } else if (type == 'Физическое лицо') {

                let subjectSection = Templates.getSection('A3:I3');
                let subjectData = {tn: tn,
                                   fio: fio,
                                   job: job,
                                   jobFunction: jobFunction,
                                   reward: reward,
                                   order: order,
                                   petitioner: petitioner,
                                   birthDate : birthDate
                };
                Table.addSection(subjectSection, subjectData);
            }
        }
    }    
}
